description:
&quot;Naughty exchange student Chayse Evans is back to cause more drama in Volume 2 of this delightful tale of sexual indiscretion. Nicole is infuriated when she learns that Chayse seduced her true love Manuel, so she finally confesses her love for him. But when Chayse overhears the two making love, she exacts her revenge by seducing Nicole's married father, David. Meanwhile, David's long suffering wife Elexis seeks comfort in the manly arms of Nicole's boyfriend, Marco. Tempers finally reach a boiling point in an explosive sexual showdown between Elexis and Chayse.&quot;

Nicole Ray, Chayse Evans, Elexis Monroe, David Perry, Marco Banderas, Manuel Ferrara

